syntax = "proto3";

package com.unblock.proto;
option java_package = "com.unblock.proto";

import "point.proto";

message GooglePlace {
    string placeId = 1;

    string name = 2;

    com.unblock.proto.Point location = 3;

    string photoUrl = 4;

    string googleUrl = 5;

    string website = 6;
}
